import { width } from '@mui/system';
import React, { useState } from 'react'
import { useEffect } from 'react';
import Datatable from '../../components/datatable/Datatable'

import { rows, columns } from '../../datatablesource.js'
import axios from 'axios'

const tableHeaders = [
    { field: 'id', headerName: 'ID', width: 70 },
    { field: 'name', headerName: 'Full name', width: 130 },
    { field: 'phone', headerName: 'Phone', width: 130 },
    {
        field: 'email',
        headerName: 'Email',
        type: 'email',
        sortable: false,
        width: 130,
    },
    {
        field: 'gender',
        headerName: 'Gender',
        width: 90
    },
    {
        field: 'address',
        headerName: 'Address',
        width: 180
    },
    {
        field: 'bloodGroup',
        headerName: 'Blood Group',
        width: 130
    },
    {
        field: 'dob',
        headerName: 'Date Of Birth',
        width: 130
    }
];

const PatientsDataTable = () => {
    const [patients, setPatients] = useState([]);

    const getPatients = async () => {
            const response = axios.get('http://103.187.8.15:8080/impl/api/v1/patients',
            {headers:{
                'Authorization' : 'Bearer eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJhYXJvZ3lhLXVzZXIiLCJleHAiOjE2NjI5MDg0MjQsImlhdCI6MTY2Mjg3MjQyNH0.n6LkL4sojhw93Rsd8vaYbL6aoRQtQT2zuq5a-2zPeKlt5aS6gAahUN7jPH7Nq_TFhJevPswFVtwC_Spomfe1yw'
            }}).then(
                res => {
                    setPatients(res.data.data);
                }
            ).catch(err =>{
                console.log(err);
            });
    }

    useEffect(() => {
        getPatients()
    }, []);

    return (
        <div className='patientDataTable'>
            <Datatable columns={tableHeaders} rows={patients} />
        </div>
    )
}

export default PatientsDataTable
